import React from "react";
import Details from "./Details";
import Name from "./Name";

export function Entry(props) {
    return (
        <dl className="dictionary">

            <div className="term">

                <Name />
                <Name emojiName={props.name} />

                <dd>
                    <Details detailInfo={props.meaning} />
                </dd>
            </div>
        </dl>

    );
}
